import React from 'react';

const About_Us = () => {
  return (
    <div
      style={{
        display: 'grid',
        gridTemplateColumns: 'repeat(3, 1fr)',
        gridGap: 20,
        padding: 30
      }}
    >
      <div>1</div>
      <div>2</div>
      <div>3</div>
    </div>
  );
};

export default About_Us;
